import React from 'react';

const ImageLinkForm = () => {
    return (
        <div>
            <p className='f3'>
                {'O cérebro irá detectar rostos em suas fotos.Tente'}
            </p>
            <div>
                <input className='f4 pa2 w-50 center' type='text' />
                <button className='w-20 grow f4 link ph3 pv2 dib white bg-light-purple'>Detectar!</button>
            </div>
        </div>
    );
}

export default ImageLinkForm;
